import React, { useContext } from 'react';
import { UserContext } from '../UserContext';
import { Link, Navigate, useParams } from 'react-router-dom';

export default function AccountPage() {
    const { user, ready } = useContext(UserContext);
    const { subpage } = useParams(); // Move useParams to the top

    if (!ready) {
        return 'Loading...';
    }

    if (ready && !user) {
        return <Navigate to={'/login'} />;
    }

    // console.log(subpage); // Uncomment if you need to debug

    return (
        <div>
            <nav className='w-full flex justify-center mt-8 gap-2'>
                <Link to={'/account'} className='p-2 px-6 bg-primary text-white rounded-full'>My Profile</Link>
                <Link to={'/account/bookings'} className='p-2 px-6 bg-primary text-white rounded-full'>My Bookings</Link>
                <Link to={'/account/places'} className='p-2 px-6 bg-primary text-white rounded-full'>My Accommodations</Link>
            </nav>
        </div>
    );
}
